import * as React from 'react';
import PropTypes from 'prop-types';
import Box from '@mui/material/Box';
import Collapse from '@mui/material/Collapse';
import IconButton from '@mui/material/IconButton';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import Grid from '@mui/material/Grid2';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';

import Appbar from './Appbar.js'
import {useState} from 'react'

// Create order data with products and total prices
function createData(orderDate, totalItems, totalPrice, items) {
  return {
    orderDate,
    totalItems,
    totalPrice,
    items, // Array of products in the order
  };
}

// Each row represents an order
const rows = [
  createData('2023-10-01', 3, 100.00, [
    { productName: 'Product 1', quantity: 1, price: 30.00 },
    { productName: 'Product 2', quantity: 2, price: 40.00 },
    { productName: 'Product 3', quantity: 1, price: 30.00 },
  ]),
  createData('2023-10-02', 2, 60.00, [
    { productName: 'Product 4', quantity: 1, price: 40.00 },
    { productName: 'Product 5', quantity: 1, price: 20.00 },
  ]),
];

// Row component with collapsible product list
function Row(props) {
  const { row } = props;
  const [open, setOpen] = React.useState(false);

  return (
    <React.Fragment>
      <TableRow sx={{ '& > *': { borderBottom: 'unset' } }}>
        <TableCell>
          <IconButton
            aria-label="expand row"
            size="small"
            onClick={() => setOpen(!open)}
          >
            {open ? <KeyboardArrowUpIcon /> : <KeyboardArrowDownIcon />}
          </IconButton>
        </TableCell>
        <TableCell component="th" scope="row">
          {row.orderDate}
        </TableCell>
        <TableCell align="left">{row.totalItems}</TableCell>
        <TableCell align="left">${row.totalPrice.toFixed(2)}</TableCell>
      </TableRow>

      {/* Collapsible section for showing purchased items */}
      <TableRow>
        <TableCell style={{ paddingBottom: 0, paddingTop: 0 }} colSpan={6}>
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ margin: 1 }}>
              <Typography variant="h6" gutterBottom component="div">
                Purchased Items
              </Typography>
              <Table size="small" aria-label="purchases">
                <TableHead>
                  <TableRow>
                    <TableCell>Product Name</TableCell>
                    <TableCell align="left">Quantity</TableCell>
                    <TableCell align="left">Price ($)</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {row.items.map((item, index) => (
                    <TableRow key={index}>
                      <TableCell component="th" scope="row">
                        {item.productName}
                      </TableCell>
                      <TableCell align="left">{item.quantity}</TableCell>
                      <TableCell align="left">${item.price.toFixed(2)}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </React.Fragment>
  );
}

Row.propTypes = {
  row: PropTypes.shape({
    orderDate: PropTypes.string.isRequired,
    totalItems: PropTypes.number.isRequired,
    totalPrice: PropTypes.number.isRequired,
    items: PropTypes.arrayOf(
      PropTypes.shape({
        productName: PropTypes.string.isRequired,
        quantity: PropTypes.number.isRequired,
        price: PropTypes.number.isRequired,
      })
    ).isRequired,
  }).isRequired,
};

// Main component to display the table
export default function OrderPage() {
    const [isLoggedIn, setIsLoggedIn] = useState(true); 
    const userData = {
      shoppingCartItems: 3, 
    };
  return (
    <div>
    <Appbar isLoggedIn={isLoggedIn} userData={userData}/>
    <Grid container justifyContent="center" alignItems="flex-start" spacing={2} style={{minHeight:'100vh', backgroundColor: '#ededed'}}>
      <Card sx={{ padding: 2, marginTop: '32px', marginBottom: '32px', width:'90%'}}>
        <CardContent>
          <Typography variant='h6'>Order History</Typography>
          <TableContainer component={Paper} sx={{marginTop: '32px', marginBottom: '32px'}}>
            <Table aria-label="collapsible table">
              <TableHead>
                <TableRow>
                  <TableCell />
                  <TableCell>Order Date</TableCell>
                  <TableCell align="right">Items Purchased</TableCell>
                  <TableCell align="right">Total Price ($)</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map((row, index) => (
                  <Row key={index} row={row} />
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </CardContent>
      </Card>
    </Grid>
    </div>
  );
}
